(1, 'Hotel Taj Mahal, Apollo Bandar, Colaba, Mumbai, Maharashtra, India', 'GOA', '<p>4-hour street food walking tour in Old Delhi<br />Stroll through bustling streets packed with food stands<br />Taste goodies like sweet jalebis, yogurt based dahi bhalla, and aloo chaat (fried potatoes)<br />Learn about Old Delhi&rsquo;s history</p>', NULL, NULL, NULL, '1', '2019-12-05', '500', NULL, NULL, 'National Park', NULL, 'Maharashtra', 'MUBAI', '1', '<p>4-hour street food walking tour in Old Delhi<br />Stroll through bustling streets packed with food stands<br />Taste goodies like sweet jalebis, yogurt based dahi bhalla, and aloo chaat (fried potatoes)<br />Learn about Old Delhi&rsquo;s history</p>', '2.jpg', '3', 'Mumbai, Maharashtra, India', 'India'),
(2, 'Hill station, Maharashtra, India', 'MUABBAI', '<h2><strong>Mahabaleshwar Tourism</strong></h2>\r\n<p><br />A hill town in Western Ghats, apart from its strawberries, Mahabaleshwar is also well known for its numerous rivers, magnificent cascades and majestic peaks.</p>\r\n<p>Mahabaleshwar is a hill station located in the Western Ghats, in Satara district of Maharashtra. Known for its captivating beauty and the beautiful strawberry farms, the city comprises of ancient temples, boarding schools, manicured and lush green dense forest, waterfalls, hills, valleys. The city is definitely among the most sought after weekend getaways from Mumbai. Charming views, enticing valleys, serene lakes and a refreshing delight for your taste buds - the best way to summarize this natures gift.</p>', NULL, NULL, NULL, '1', '2019-12-10', '22', NULL, NULL, 'Adventure Type', NULL, '', 'DELHI', '1', '<p><strong>Mahabaleshwar Tourism</strong><br />A hill town in Western Ghats, apart from its strawberries, Mahabaleshwar is also well known for its numerous rivers, magnificent cascades and majestic peaks.</p>\r\n<p>&nbsp;</p>', '1536384840cats-38-620x413-1-1.jpg', '4', 'Mahabaleshwar, Maharashtra, India', 'Nigeria'),
(3, 'Lonavala', '', '<h3>Summer: March, April, and May are the hottest months, but thunderstorm are common in the cities and hill stations. The temperature ranges between 22&deg;C to 39&deg;C during summer months.</h3>\r\n<p><strong>Monsoon:</strong> June, July, August, and September bring relief to many regions of Maharashtra, especially the hill stations. July and August are the wettest months here. The lush green meadows, valleys, and rugged mountains look even more beautiful during monsoon. It is the best time to visit Maharashtra for those who love rains.</p>\r\n<h4>Winter: October, November, and December are the coolest and driest months in Maharashtra. One can feel cool breeze and enjoy the clear blue skies during winter. Some of the regions of Maharashtra receive little rainfall in winter, and the temperature remains between 12&deg;C-34&deg;C.</h4>', NULL, NULL, NULL, '1', '2019-12-05', '', NULL, NULL, 'Adventure Type', NULL, '', 'KOLKATA', '1', '<p><strong>Summer:</strong> March, April, and May are the hottest months, but thunderstorm are common in the cities and hill stations. The temperature ranges between 22&deg;C to 39&deg;C during summer months.</p>', '1536943059river-rafting250.jpg', '5', '', 'Nigeria');
