(1, '<div class=\"g-group l-lg-mar-bot-6 l-md-mar-bot-4  \">&nbsp;</div>\r\n<div class=\"g-group l-mar-bot-6 l-sm-mar-bot-4\">\r\n<div class=\"structured-content g-cell g-cell-10-12 g-cell-md-1-1\">\r\n<div class=\"has-user-generated-content\" data-automation=\"about-this-event-sc\">\r\n<div class=\"structured-content-rich-text structured-content__module l-align-left l-mar-vert-6 l-sm-mar-vert-4 text-body-medium\">\r\n<p>Join the CEO of Magic Dzuleira Abu Bakar and Digi Digital Chief Officer Praveen Rajan to give insights on the startup scene.</p>\r\n<p>What can we expect from the startup world in 2020? What are the likely trends and predictions? Join us at this round table event where some of the industry\'s top movers and shakers kick-start the discussion on \'vision 2020\' for the startup world.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', '2020-02-29 00:00:00', NULL, '1', '1', 'yes', 'Startup Breakfast Club: 2020 Landscape', 'Patna', '', 'Communities', '500', '01:30 PM', NULL, '<p>Lorem ipsum dolor sit amet, at omnes deseruisse pri. Quo aeterno legimus insolens ad. Sit cu detraxit constituam, an mel iudico constituto efficiendi. Eu ponderum mediocrem has, vitae adolescens in pro. Mea liber ridens inermis ei, mei legendos vulputate an, labitur tibique te qui. Omnes deseruisse pri. Quo aeterno legimus insolens ad. Sit cu detraxit constituam, an mel iudico constituto efficiendi. Eu ponderum mediocrem has, vitae adolescens in pro. Mea liber ridens inermis ei, mei legendos vulputate an, labitur tibique te qui. Mel iudico constituto efficiendi. Eu ponderum mediocrem has, vitae adolescens in pro. Mea liber ridens inermis ei, mei legendos vulputate an, labitur tibique te qui. Enjoy a self-guided tour through the home stadium of Messi, Neymar, Iniesta and Suarez, including the opportunity to walk onto the famous pitch surrounded by nearly 100,000 screaming fans (you\'ll need to imagine the last part) See 23 Liga and five Champions League trophies in a trophy cabinet that looks more like a treasure chest Experience the very cool and interactive museum, with touch screens, sound installations that put you at the heart of the action</p>', 'yes'),
(2, '<div class=\"g-group l-lg-mar-bot-6 l-md-mar-bot-4  \">\r\n<div class=\"g-cell g-cell-10-12 g-cell-md-1-1\">\r\n<div class=\"has-user-generated-content js-d-read-more read-more js-read-more read-more--medium-down read-more--expanded\" data-xd-wired=\"read-more\">\r\n<div class=\"js-xd-read-more-toggle-view read-more__toggle-view\">\r\n<div class=\"js-xd-read-more-contents text-body-medium\" data-automation=\"listing-event-description\"><strong>Starting off with the CNY Buffet Dinner today!</strong></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"g-group l-mar-bot-6 l-sm-mar-bot-4\">\r\n<div class=\"structured-content g-cell g-cell-10-12 g-cell-md-1-1\">\r\n<h2 class=\"text-body-large hide-small\">About this Event</h2>\r\n<div class=\"has-user-generated-content\" data-automation=\"about-this-event-sc\">\r\n<div class=\"structured-content-rich-text structured-content__module l-align-left l-mar-vert-6 l-sm-mar-vert-4 text-body-medium\">\r\n<p>Pre CNY Reunion Buffet Dinner</p>\r\n<p>17th - 23rd January 2020</p>\r\n<p>RM80.00+ Adult</p>\r\n<p>RM60.00+ Sr Citizen</p>\r\n<p>RM40.00+ Child</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', '2020-02-05 00:00:00', 'event-category-3_61.jpg', NULL, NULL, 'yes', 'CNY Buffet', 'Mumbai', NULL, 'Concerts', '200', '03:30 PM', NULL, 'Lorem ipsum dolor sit amet, at omnes deseruisse pri. Quo aeterno legimus insolens ad. Sit cu detraxit constituam, an mel iudico constituto efficiendi. Eu ponderum mediocrem has, vitae adolescens in pro. Mea liber ridens inermis ei, mei legendos vulputate an, labitur tibique te qui.\r\n\r\nOmnes deseruisse pri. Quo aeterno legimus insolens ad. Sit cu detraxit constituam, an mel iudico constituto efficiendi. Eu ponderum mediocrem has, vitae adolescens in pro. Mea liber ridens inermis ei, mei legendos vulputate an, labitur tibique te qui. Mel iudico constituto efficiendi. Eu ponderum mediocrem has, vitae adolescens in pro. Mea liber ridens inermis ei, mei legendos vulputate an, labitur tibique te qui.\r\n\r\nEnjoy a self-guided tour through the home stadium of Messi, Neymar, Iniesta and Suarez, including the opportunity to walk onto the famous pitch surrounded by nearly 100,000 screaming fans (you\'ll need to imagine the last part) See 23 Liga and five Champions League trophies in a trophy cabinet that looks more like a treasure chest Experience the very cool and interactive museum, with touch screens, sound installations that put you at the heart of the action', 'yes'),
(3, '<h3 class=\"label-primary\">Description</h3>\r\n<div class=\"has-user-generated-content js-d-read-more read-more js-read-more read-more--medium-down read-more--expanded\" data-xd-wired=\"read-more\">\r\n<div class=\"js-xd-read-more-toggle-view read-more__toggle-view\">\r\n<div class=\"js-xd-read-more-contents l-mar-top-3\" data-automation=\"listing-event-description\">\r\n<div>\r\n<div class=\"_1mf _1mj\">In Latin Solo, we learn Latin dances as solo dancers, without partners. No need to look for partners, no need to worry about stepping on your partner\'s foot!</div>\r\n</div>\r\n<div>\r\n<div class=\"_1mf _1mj\">&nbsp;</div>\r\n</div>\r\n<div>\r\n<div class=\"_1mf _1mj\">Don\'t worry if you don\'t know how to move to music. That\'s why we go for dance classes!!!</div>\r\n</div>\r\n<div>\r\n<div class=\"_1mf _1mj\">&nbsp;</div>\r\n</div>\r\n<div>\r\n<div class=\"_1mf _1mj\">We have a few new intakes this coming new year!</div>\r\n</div>\r\n<div>\r\n<div class=\"_1mf _1mj\">We are opening a new MORNING class for ladies who have available time in the morning!</div>\r\n<div class=\"_1mf _1mj\">We will PM the exact location for participants who have signed up.</div>\r\n</div>\r\n<div>\r\n<div class=\"_1mf _1mj\">&nbsp;</div>\r\n</div>\r\n<div>\r\n<div class=\"_1mf _1mj\">Terms and Conditions:</div>\r\n</div>\r\n<div>\r\n<div class=\"_1mf _1mj\">1. This offer is for first-time students only.</div>\r\n</div>\r\n<div>\r\n<div class=\"_1mf _1mj\">2. This offer cannot be exchanged for another offer.</div>\r\n</div>\r\n<div>\r\n<div class=\"_1mf _1mj\">3. This offer is valid for this trial class only.</div>\r\n</div>\r\n<div>\r\n<div class=\"_1mf _1mj\">4. Participants must book their spots before coming.</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', '2020-01-31 00:00:00', 'event-category-6_5.jpg', NULL, NULL, 'yes', 'Latin Solo Trial - Tuesday Morning', 'New Delhi', NULL, 'SPORTS', '100', '01:30 PM', NULL, 'Lorem ipsum dolor sit amet, at omnes deseruisse pri. Quo aeterno legimus insolens ad. Sit cu detraxit constituam, an mel iudico constituto efficiendi. Eu ponderum mediocrem has, vitae adolescens in pro. Mea liber ridens inermis ei, mei legendos vulputate an, labitur tibique te qui.\r\n\r\nOmnes deseruisse pri. Quo aeterno legimus insolens ad. Sit cu detraxit constituam, an mel iudico constituto efficiendi. Eu ponderum mediocrem has, vitae adolescens in pro. Mea liber ridens inermis ei, mei legendos vulputate an, labitur tibique te qui. Mel iudico constituto efficiendi. Eu ponderum mediocrem has, vitae adolescens in pro. Mea liber ridens inermis ei, mei legendos vulputate an, labitur tibique te qui.\r\n\r\nEnjoy a self-guided tour through the home stadium of Messi, Neymar, Iniesta and Suarez, including the opportunity to walk onto the famous pitch surrounded by nearly 100,000 screaming fans (you\'ll need to imagine the last part) See 23 Liga and five Champions League trophies in a trophy cabinet that looks more like a treasure chest Experience the very cool and interactive museum, with touch screens, sound installations that put you at the heart of the action', 'yes'),
