INSERT INTO `hotel` (`id`, `title`, `place`, `detail`, `chkin`, `chkout`, `starrating`, `status`, `date`, `price`, `discount`, `amenities`, `roomdetail`, `stateid`, `cityid`, `day`, `night`, `facilityid`, `hid`, `nooffloor`, `noofroom`, `address`, `landmark`, `rateid`, `popularplaceid`, `picture`, `datebiserate`) VALUES
(1, 'The Lalit', '', 'The Lalit New Delhi is strategically located right next to business and commercial districts, shopping centres, trade fair ground, and Connaught Place. It is merely 5 minutes away from the railway station. Some of the major tourist attractions close to the hotel are Jama Masjid (approx 6km), Jantar Mantar (approx 6km), India Gate (approx 8km), Connaught Place, Rajghat, Red Fort. Other important places of interest are Qutub Minar, Rashtrapati Bhawan, and Humayun s Tomb. Barakhamba Metro Station is 0.5 kms (approx.) from the hotel. The Lalit New Delhi is an 18 storey 5 star luxury hotel near Connaught Place with elegant interiors, impeccable service and fine cuisine. The hotel houses 4 dining outlets, 6 banquet halls, and a nightclub making a perfect setting for the business and leisure travelers. Contemporary and uber-stylish rooms at The Lalit ensure maximum comfort. ', '', '', 5, '1', '2020-01-31', 5899, '0', '', 'The hotel offers 461 accommodation units, which are categorised as Deluxe Room, Lalit View Room, Executive Club Room, Lalit Luxury Room, Executive Suite, Indian Suite, Luxury Suite and Presidential Suite. These rooms are featured with modern amenities like tea/coffee maker, plasma television with DVD player, electronic safe and mini bar. ', '1', '1', '', '', '', 0, '18', '461', 'Barakhamba Avenue, Connaught Place New Delhi - 110001 Delhi, India', 'Connaught Place', 'a:1:{i:0;s:1:\"1\";}', '0', 'thelalitnewdelhimain.jpg', NULL),
(2, 'The Taj', '', 'Taj Palace Hotel is situated at Sardar Patel Marg, Diplomatic Enclave, Chanakyapuri, New Delhi, in proximity to the Indira Gandhi International Airport, Parliament House, Rail Museum (approx 2km), India Gate (approx 7km), Connaught Place (approx 7km), Lodhi s Tomb, Chandni Chowk, Rashtrapati Bhavan, Mughal Gardens and other cultural places of the Heritage Capital of India.A part of prestigious Taj Group of Hotels, the Taj Palace hotel, New Delhi exudes the signature Taj splendour and glamour. It is a perfect embodiment of world-class luxury and hospitality.', '12:00 NOON', '', 5, '1', '2020-01-31', 15000, '0', '', 'All the hotels rooms are equipped with facilities like, tea/coffee maker, LCD color television, direct dial telephone, channel music, attached washroom with shower and twenty four hours room service. It offers Double Bedded, Triple bedded & Four bedded rooms to match each and every type of clientage. All rooms are tastefully decorated to be able to make your memories here.  ', '1', '1', '', '', '', 0, '9', '402', 'Sardar Patel Marg, Diplomatic Enclave New Delhi - 110021 Delhi, India', 'Sardar Patel Marg', 'N;', '0', 'TajPalaceHotel1.jpg', NULL),
(3, 'parkplaza', '', '<p>333</p>', '<p>33</p>', '<p>33</p>', 3, '1', '2020-01-31', 4000, '0', '', '<p>333</p>', '4', '4', '', '', '', 0, '', '', '', '', '0', '0', '', NULL),
(4, 'Agra ', '', 'Agra', 'Agra', 'Agra', 3, '1', '2020-01-31', 5000, '0', '', 'Agra', '1', '1', '', '', '', 0, '', '', '', '', '0', '0', '', NULL),
(17, 'Jai Maa Inn Hotel, Katra', '', 'Jai Maa Inn Hotel, Katra is Located at Kashmir Road, Katra, Jai Ma Inn Hotels is in close proximity to Darshani Dwar (Approx. 1km) and Himkoti (Approx. 2km). The mythical Darshani Dwar is the starting point for the holy journey to the revered Vaishno Devi temple. Tourist should not miss the other destinations such as Charanpaduka, Baba Dhansar Temple and Vaishno Devi Temple. It offers in-house eating place that serves fingerlicious food. This place has lovely landscape that allures massive crowd annually.Hotel provides facilities like Travel information & Assistance, Local guide, Air/Railway/Bus reservations, Pickup/Drop from Airport/Railway station/Bus stand. Also provides Sightseeing tour on request.\r\n\r\n\r\n', '12.00 NOON', '', 3, '1', '2020-01-31', 2030, '0', '', 'All the rooms are equipped with facilities like, tea/coffee maker, LCD color television, direct dial telephone,attached washroom with shower and twenty four hours room service .It offers Double Bedded, Triple bedded & Four bedded rooms to match each and every type of clientage.All rooms are tastefully decorated to be able to make your memories here. ', '22', '12', '', '', '', 0, '3', '50', 'Kashmir Road Vaishno Devi Katra Jammu And Kashmir - 182301 India', 'Kashmir Road', 'N;', '0', '67499-JaiMaaInnHotelKatra.jpg', NULL),
(18, 'Hotel Mount View, Katra', '', 'Hotel Mount View, Katra offers comfy and reasonable keep for each business and leisure travelers who looking for some economical decisions.It is a professionally managed hotel in the heart of the city. This property is created from fine interiors with pure surroundings that creates a convenient accommodate for travellers. It offers in-house eating place that serves fingerlicious food. This place has lovely landscape that allures massive crowd annually.Hotel provides facilities like Travel information & Assistance, Local guide, Air/Railway/Bus reservations, Pickup/Drop from Airport/Railway station/Bus stand. Also provides Sightseeing tour on request.', '', '', 3, '1', '2020-01-31', 2800, '0', '', 'All the rooms are equipped with facilities like, tea/coffee maker, LCD color television, direct dial telephone,attached washroom with shower and twenty four hours room service .It offers Double Bedded, Triple bedded & Four bedded rooms to match each and every type of clientage.All rooms are tastefully decorated to be able to make your memories here. ', '22', '12', '', '', '', 0, '4', '70', 'Katra Vaishno Devi Katra Jammu And Kashmir India', 'Katra Vaishno Devi', 'N;', '0', '44781-HotelMountViewKatra.jpg', NULL),
(19, 'Vishal Hotel, Katra', '', 'Vishal Hotel, Katra  is located at Arli Road, Katra. It is easy to reach the Aghaar Baba Jitto (Approx. 7km) and Geeta Mandir (Approx. 2km) which is located close to the hotel. Aghaar Baba Jitto was a devotee of Mata Vaishno Devi and a revolutionary who led a campaign against the feudal order. Devotees visit the shrine to seek divine blessings in the holy spring water which does miracles to pre-natal women for safe delivery. Other distant places which can also be toured are Nau Devian, Baba dhansar and Jhajjar Kotli Park. It offers in-house eating place that serves fingerlicious food. This place has lovely landscape that allures massive crowd annually.Hotel provides facilities like Travel information & Assistance, Local guide, Air/Railway/Bus reservations, Pickup/Drop from Airport/Railway station/Bus stand. Also provides Sightseeing tour on request.\r\n\r\n', '', '', 3, '1', '2020-01-31', 1770, '0', '', 'All the rooms are equipped with facilities like, tea/coffee maker, LCD color television, direct dial telephone,attached washroom with shower and twenty four hours room service .It offers Double Bedded, Triple bedded & Four bedded rooms to match each and every type of clientage.All rooms are tastefully decorated to be able to make your memories here. ', '22', '12', '', '', '', 0, '3', '80', 'Behind Durga Bhawan Vaishno Devi, Arli Road Katra , Jammu Jammu And Kashmir - 182301 India', 'Behind Durga Bhawan Vaishno Devi', 'N;', '0', '36043-VishalHotelKatra.jpg', NULL),
(20, 'Bhawani International Hotel, Katra', '', 'Bhawani International Hotel, Katra  is located at main bus stand and is close to key tourist attractions like Darshani Dwar (Approx. 1km) and Banganga Temple (Approx. 2km). Darshani Dwar or Darshani Deodhi is the main starting point for the famous Mata Vaishno Devi Yatra. This legendary spot also has a stunning view of the surrounding Trikuta Mountains. Jhajjar Kotli Park, Bhairon Temple and Geeta Mandir are other significant sightseeing spots.It offers in-house eating place that serves fingerlicious food. This place has lovely landscape that allures massive crowd annually.Hotel provides facilities like Travel information & Assistance, Local guide, Air/Railway/Bus reservations, Pickup/Drop from Airport/Railway station/Bus stand. Also provides Sightseeing tour on request.\r\n\r\n', '', '', 2, '1', '2020-01-31', 1790, '0', '', 'All the rooms are equipped with facilities like, tea/coffee maker, LCD color television, direct dial telephone,attached washroom with shower and twenty four hours room service .It offers Double Bedded, Triple bedded & Four bedded rooms to match each and every type of clientage.All rooms are tastefully decorated to be able to make your memories here. ', '22', '12', '', '', '', 0, '2', '42', 'Bus Stand, Katra Vaishno Devi Jammu And Kashmir India', 'Bus Stand', 'N;', '0', '76594-BhawaniInternationalHotelKatra.jpg', NULL),
(21, 'Gupta Palace Hotel, Katra', '', 'Gupta Palace Hotel, Katra is strategically located at hospital road. Some of the nearby places of tourist attraction in the vicinity are Darshani Dwar (Approx. 1km) and Himkoti (Approx. 2km). The Darshani Darwaza is the entry gate to the Mata Vaishno Devi Yatra. It is from this point that tourists can have a complete view of the Trikuta Mountain. Other places of tourist importance are Charanpaduka, Baba Dhansar Temple and Vaishno Devi Temple.It offers in-house eating place that serves fingerlicious food. This place has lovely landscape that allures massive crowd annually.Hotel provides facilities like Travel information & Assistance, Local guide, Air/Railway/Bus reservations, Pickup/Drop from Airport/Railway station/Bus stand. Also provides Sightseeing tour on request.\r\n\r\n', '', '', 2, '1', '2020-01-31', 1150, '0', '', 'All the rooms are equipped with facilities like, tea/coffee maker, LCD color television, direct dial telephone,attached washroom with shower and twenty four hours room service .It offers Double Bedded, Triple bedded & Four bedded rooms to match each and every type of clientage.All rooms are tastefully decorated to be able to make your memories here. ', '22', '12', '', '', '', 0, '3', '32', 'Mata Vaishno Devi Hospital Road, Katra Udhampur Dist. Jammu And Kashmir - 182301 India', 'Mata Vaishno Devi Hospital Road', 'N;', '0', '35002-GuptaPalaceHotelKatra.jpg', NULL),
(22, 'Mayur Hotel, Katra', '', 'Mayur Hotel, Katra n the heart of Katra closest to the Railway station , to Helipad and to Ban Ganga , Graciously appointed air-condition rooms , with 24 hour room service , Multi cuisine vegetarian Restaurant , in house laundry service and free Internet Facility.It offers in-house eating place that serves fingerlicious food. This place has lovely landscape that allures massive crowd annually.Hotel provides facilities like Travel information & Assistance, Local guide, Air/Railway/Bus reservations, Pickup/Drop from Airport/Railway station/Bus stand. Also provides Sightseeing tour on request.\r\n\r\n\r\n', '', '', 3, '1', '2020-01-31', 1890, '0', '', 'All the rooms are equipped with facilities like, tea/coffee maker, LCD color television, direct dial telephone,attached washroom with shower and twenty four hours room service .It offers Double Bedded, Triple bedded & Four bedded rooms to match each and every type of clientage.All rooms are tastefully decorated to be able to make your memories here. ', '22', '12', '', '', '', 0, '3', '34', 'Kashmir Road Katra, Udhampur Dist. Jammu And Kashmir - 182301 India', 'Kashmir Road Katra', 'N;', '0', '66785-MayurHotelKatra.JPG', NULL),
(23, 'Ambica Hotel, Katra', '', 'Ambica Hotel, Katra is located in the heart of town and is easily accessible. Hotel Facilities The hotel also has a health club that is equipped with facilities like steam and jacuzzi.This property is created from fine interiors with pure surroundings that creates a convenient accommodate for travellers. It offers in-house eating place that serves fingerlicious food. This place has lovely landscape that allures massive crowd annually.Hotel provides facilities like Travel information & Assistance, Local guide, Air/Railway/Bus reservations, Pickup/Drop from Airport/Railway station/Bus stand. Also provides Sightseeing tour on request.\r\n\r\n', '', '', 2, '1', '2020-01-31', 2570, '0', '', 'All the rooms are equipped with facilities like, tea/coffee maker, LCD color television, direct dial telephone,attached washroom with shower and twenty four hours room service .It offers Double Bedded, Triple bedded & Four bedded rooms to match each and every type of clientage.All rooms are tastefully decorated to be able to make your memories here. ', '22', '12', '', '', '', 0, '4', '58', 'Vaishnodevi Jammu And Kashmir - 182301 India', 'Vaishnodevi ', 'N;', '0', '71406-AmbicaHotelKatra.jpg', NULL),
(24, 'Kashmir Residency Hotel, Katra', '', 'Kashmir Residency Hotel, Katra is located at main road, Vaishnodevi. Raghunath temple (approx. 1kms) and Ardhkuwari Mata Gufa (approx. 2kms) are proximate places to explore from the hotel. Ardhkuwari is considered to be one of the most important destination while on a visit to Mata Vaishno Devi temple. Its a cave where Goddess Vaishno meditated for nine months. Some other exciting places of visit include Banganga Temple, Aghaar Baba Jitto and Mahadev Talab.he basic amenities offered to the guests include 24-hour front desk, room service, parking, 24-hour security and doctor-on-call. Patrons can enjoy invigorating massage services, sauna, steam bath, Jacuzzi at the health club. Corporate events can be well-arranged with the help of conference facilities, business services and conference suite. Appetizing Gujarati and Maharashtrian food awaits guests at the fully air conditioned in-house Maheman restaurant. \r\n\r\n', '', '', 3, '1', '2020-01-31', 2200, '0', '', 'All the rooms are equipped with facilities like, tea/coffee maker, LCD color television, direct dial telephone,attached washroom with shower and twenty four hours room service .It offers Double Bedded, Triple bedded & Four bedded rooms to match each and every type of clientage.All rooms are tastefully decorated to be able to make your memories here. ', '22', '12', '', '', '', 0, '4', '40', 'Main Road, Katra Vaishnodevi Jammu And Kashmir - 182301 India', 'Main Road', 'N;', '0', '97782-KashmirResidencyHotelKatra.jpg', NULL),
(25, 'Hotel Shree Hari Niwas, Katra', '', 'Hotel Shree Hari Niwas, Katra Positioned opposite ICICI Bank, Jammu road, Hotel Shree Hari Niwas is flanked by Raghunath Temple (Approx. 1km) and Adhkunwari Mata Gufa (Approx. 2km). Perched on a high altitude, Adhkunwari Mata Gufa marks the halfway point of the holy yatra to the main temple. This narrow cave is believed to have immense religious importance. Banganga Temple, Aghaar Baba Jitto and Mahadev Talab are other must-see destinations.The essential amenities provided by the hotel are room service, internet connectivity, air conditioning, travel desk, non-smoking rooms, parking, 24-hour front desk, doctor-on-call and 24-hour security. Business centre and conference facilities are provided by the hotel. Workout at the gym and a rejuvenating massage service is a great way to recharge. Lazzeez, the restaurant within the premises dishes out amazing vegetarian meals. Additionally, the coffee shop also provides for a variety of beverages and snacks.', '', '', 4, '1', '2020-01-31', 2600, '0', '', 'All the rooms are equipped with facilities like, tea/coffee maker, LCD color television, direct dial telephone,attached washroom with shower and twenty four hours room service .It offers Double Bedded, Triple bedded & Four bedded rooms to match each and every type of clientage.All rooms are tastefully decorated to be able to make your memories here. ', '22', '12', '', '', '', 0, '4', '52', 'Katra Vaishno Devi Jammu And Kashmir - 182301 India', 'Katra Vaishno Devi', 'N;', '0', '33814-HotelShreeHariNiwasKatra.jpg', NULL),
(26, 'Varun Hotel, Katra', '', 'Varun Hotel, Katra is located at Kashmir road. The hotel is surrounded by places of religious importance like Aghaar Baba Jitto (Approx. 6km) and Bhairavnath Temple (Approx. 2km). In order to complete their holy journey, guests have to visit the Bhairavnath Temple which is dedicated to a saint by that name. Guests can also spend their leisure time in visiting places like Vaishno Devi Temple, Ardh Kuwari Cave and Baba Dhansar.This property is created from fine interiors with pure surroundings that creates a convenient accommodate for travellers. It offers in-house eating place that serves fingerlicious food. This place has lovely landscape that allures massive crowd annually.Hotel provides facilities like Travel information & Assistance, Local guide, Air/Railway/Bus reservations, Pickup/Drop from Airport/Railway station/Bus stand. Also provides Sightseeing tour on request.\r\n\r\n', '', '', 3, '1', '2020-01-31', 1930, '0', '', 'All the rooms are equipped with facilities like, tea/coffee maker, LCD color television, direct dial telephone,attached washroom with shower and twenty four hours room service .It offers Double Bedded, Triple bedded & Four bedded rooms to match each and every type of clientage.All rooms are tastefully decorated to be able to make your memories here. ', '22', '12', '', '', '', 0, '4', '40', 'Kashmir Road Katra, Udhampur Dist. Jammu And Kashmir - 182301 India', 'Kashmir Road Katra', 'N;', '0', '76467-VarunHotelKatra.jpg', NULL),
(27, 'KC Residency, Katra', '', 'KC Residency, Katra is stands tall at Reasi Road in Katra and has hindrance free access to places like Vaishno Devi Temple 4 km (approx.), Bhairon Temple 3 km (approx.), Adhkunwari 42 km (approx.), Banganga 4 km (approx.), Sanjichhat 4 km (approx.), Himkoti 3 km (approx.), Charanpaduka 2 km (approx.) and Jhajjar Kotli 17 km (approx.).This property is created from fine interiors with pure surroundings that creates a convenient accommodate for travellers. It offers in-house eating place that serves fingerlicious food. This place has lovely landscape that allures massive crowd annually.Hotel provides facilities like Travel information & Assistance, Local guide, Air/Railway/Bus reservations, Pickup/Drop from Airport/Railway station/Bus stand. Also provides Sightseeing tour on request.', '', '', 4, '1', '2020-01-31', 6000, '0', '', 'All the rooms are equipped with facilities like, tea/coffee maker, LCD color television, direct dial telephone,attached washroom with shower and twenty four hours room service .It offers Double Bedded, Triple bedded & Four bedded rooms to match each and every type of clientage.All rooms are tastefully decorated to be able to make your memories here. ', '22', '12', '', '', '', 0, '6', '57', 'Reasi Road Katra (Vaishno Devi) Jammu And Kashmir Jammu And Kashmir - 182301 India', 'Reasi Road Katra', 'N;', '0', '56384-KCResidencyKatra.jpg', NULL),
(28, 'Hotel Ishan, Katra', '', 'Hotel Ishan, Katra is located near Police Station, circular road. Guests can visit nearby tourist destinations like the Vaishno Devi Temple (Approx. 2km) and the Bhairon Temple (Approx. 2km) from the hotel. Vaishno Devi is considered one of the holiest temples in India. Some other places that can be visited are the Baba dhansar, Nau Devian and the Jhajjar Kotli Park.The array of amenities rendered by Hotel Ishan features a relaxed stay. The hotel provides room service, internet, 24-hour front desk and air conditioning as basic amenities. The availability of massage services makes the guests relax and rejuvenate. The in- house multi-cuisine pure vegetarian restaurant serves a wide variety of delicacies that satiate the taste buds of patrons.\r\n\r\n', '', '', 2, '1', '2020-01-31', 1690, '0', '', 'All the rooms are equipped with facilities like, tea/coffee maker, LCD color television, direct dial telephone,attached washroom with shower and twenty four hours room service .It offers Double Bedded, Triple bedded & Four bedded rooms to match each and every type of clientage.All rooms are tastefully decorated to be able to make your memories here. ', '22', '12', '', '', '', 0, '3', '50', 'Bus Stand Circular Road, Near Police Station Vaishno Devi Katra Jammu And Kashmir - 182301 India', 'Bus Stand Circular Road', 'N;', '0', '94261-HotelIshanKatra.jpg', NULL),
(29, 'Hotel Chinar, Katra', '', 'Hotel Chinar, Katra  is located at Jammu road. The hotel is close to Geeta Mandir (Approx. 1km) and Aghar Baba Jitto (Approx. 8km). Aghar Baba Jitto is a cool and scenic spot located amidst beautiful hillocks. Other popular hot spots are Nau Devian, Baba Dhansar and Jhajjar Kotli Park.It offers in-house eating place that serves fingerlicious food. This place has lovely landscape that allures massive crowd annually.Hotel provides facilities like Travel information & Assistance, Local guide, Air/Railway/Bus reservations, Pickup/Drop from Airport/Railway station/Bus stand. Also provides Sightseeing tour on request.\r\n\r\n', '', '', 3, '1', '2020-01-31', 1870, '0', '', 'All the rooms are equipped with facilities like, tea/coffee maker, LCD color television, direct dial telephone,attached washroom with shower and twenty four hours room service .It offers Double Bedded, Triple bedded & Four bedded rooms to match each and every type of clientage.All rooms are tastefully decorated to be able to make your memories here. ', '22', '12', '', '', '', 0, '3', '25', 'Jammu  Katra Road Katra, Jammu Jammu And Kashmir - 180301 India', 'Katra Road Katra', 'N;', '0', '27106-HotelChinarkatra.jpg', NULL),
(30, 'Hotel Subash International, Katra', '', 'Hotel Subash International, Katra is located at Ban Ganga road is surrounded by places of interest like Adkuwari Mata Gufa (Approx. 2km) and Banganga Temple (Approx. 2km). Pilgrims bathe in the holy waters of Banganga River and visit the Banganga Temple which is well-known for its panoramic view and religious implications. Some of the other places worth taking a trip are Bhairon Temple, Shalimar Park and Nau Devian.Leisure guests and pilgrims can enjoy a hassle-free stay with various features unleashed by the hotel. 24-hour front desk, room service, internet access, travel desk, concierge, doctor-on-call and round the clock security are some of the fundamental services. Indian and Chinese vegetarian culinary delights are available at the in-house restaurant Tulsi. Tea Leaf Cafe, the coffee shop is filled with the aroma of freshly brewed coffee and tempting snacks along with the mesmerising view of the majestic mountains. Guests can also enjoy delicious cold desserts after a sumptuous meal at the ice cream parlour.', '', '', 4, '1', '2020-01-31', 2290, '0', '', 'All the rooms are equipped with facilities like, tea/coffee maker, LCD color television, direct dial telephone,attached washroom with shower and twenty four hours room service .It offers Double Bedded, Triple bedded & Four bedded rooms to match each and every type of clientage.All rooms are tastefully decorated to be able to make your memories here. ', '22', '12', '', '', '', 0, '4', '35', 'Ban Ganga Road Katra Jammu And Kashmir - 182301 India', 'Ban Ganga Road Katra', 'N;', '0', '62858-HotelSubashInternationalKatra.jpg', NULL),
