(28, 15, 'SDCV21', 'Men Canvas Shoes - Black / Blue', '10,699', '<p>&nbsp;</p>\r\n<ul>\r\n<li>Upper Material: Canvas</li>\r\n<li>Outsole Material: Rubber</li>\r\n<li>Insole Material: Rubber</li>\r\n<li>Lining Material: Canvas</li>\r\n<li>Shoes Type: Basic</li>\r\n<li>Feature: Waterproof, Breathable, Massage, Height</li>\r\n</ul>\r\n<p><br /><strong>Special reminder:</strong>This pair of shoes are available in Asia sizes, before ordering, please check the measurement chart carefully before you buy the item. Because of this, the shoes run a size small, so it is recommended you get a size up.</p>', NULL, 'img1.jpg', NULL, NULL, '2,699', '2019-12-27 01:38:29', '1', 10, NULL, NULL, 6, NULL, 24, '0', 'yes', 'yes', NULL, 0, NULL, NULL, NULL, 'S', 'M', 'L', 'Black<br />', NULL, NULL, NULL, NULL, 'Sports', NULL, NULL, NULL, NULL, '10', '<p>Simple and classy, this pair is made from superior quality canvas material that remains stylish on the outside but with super comfy insoles and durable outsoles. Match this wardrobe classic with your favourite denim, jean, or chinos trousers and boom! Stylish casual never looked better.</p>', '', '4', 'yes', '', '', '', NULL, 0, NULL, NULL, NULL, NULL),
