(30, 12, 'SF2523', 'Hampers Christmas Hamper Exclusive Gift Combo - HPTSCH05', '15,000', '', NULL, '2 (4).jpg', NULL, NULL, '15,000', '2019-12-27 01:58:42', '1', -1, NULL, NULL, 0, NULL, 0, '0', 'yes', 'yes', NULL, 0, NULL, NULL, NULL, '', '', '', '', NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, '10', '<p>Our Traditional Christmas hampers collection showcases festive favorites to create the ultimate at-home spread. This elegant basket will impress from the moment you set eyes on it, put together with what is needed in your home. This Christmas Hamper includes the following items:</p>\r\n<ul>\r\n<li>Glass cup by 6</li>\r\n<li>Photo frame</li>\r\n<li>Manual grater</li>\r\n<li>Soap case</li>\r\n<li>Toilet brush</li>\r\n<li>Sit support</li>\r\n<li>Tray</li>\r\n<li>Microfiber&nbsp;hair drying towel</li>\r\n<li>Funnel</li>\r\n<li>Cereal bowl</li>\r\n<li>Hand towel</li>\r\n<li>Utility Kitchen towel</li>\r\n<li>Basket</li>\r\n</ul>\r\n<p>Note: Basket and Wrapper may vary</p>', '', '5', 'yes', '', '', '', NULL, 0, NULL, NULL, NULL, NULL),
