(44, 10, 'ORS11911', 'New Apple MacBook Air (13-inch, 8GB RAM, 128GB Storage) - Space Gray', '652,570.00', '<div class=\"a-section a-text-center\">\r\n<div class=\"a-section a-spacing-base\">\r\n<div>\r\n<p>MacBook Air 13-inch with Retina with True Tone (Latest Model)</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"a-section\">\r\n<div class=\"a-row\">\r\n<div class=\"a-column a-span6\">\r\n<table id=\"tech-specs-table-left\" class=\"a-bordered tech-spec-theme\">\r\n<tbody>\r\n<tr>\r\n<td class=\"a-text-bold\">\r\n<p>Display</p>\r\n</td>\r\n<td>\r\n<p>13.3-inch (diagonal) LED-backlit display with IPS technology; 2560-by-1600 native resolution at 227 pixels per inch with support for millions of colors; True Tone technology</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td class=\"a-text-bold\">\r\n<p>Processor</p>\r\n</td>\r\n<td>\r\n<p>1.6GHz dual-core Intel Core i5, Turbo Boost up to 3.6GHz, with 4MB L3 cache</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td class=\"a-text-bold\">\r\n<p>Graphics and Video Support</p>\r\n</td>\r\n<td>\r\n<p>Intel UHD Graphics 617, support for Thunderbolt 3&ndash;enabled external graphics processors (eGPUs)</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td class=\"a-text-bold\">\r\n<p>Charging and Expansion</p>\r\n</td>\r\n<td>\r\n<p>Two Thunderbolt 3 (USB-C) ports with support for:, Charging, DisplayPort, Thunderbolt (up to 40 Gbps), USB-C 3.1 Gen 2 (up to 10 Gbps)</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div class=\"a-column a-span6 a-span-last\">\r\n<table id=\"tech-specs-table-right\" class=\"a-bordered tech-spec-theme\">\r\n<tbody>\r\n<tr>\r\n<td class=\"a-text-bold\">\r\n<p>Wireless</p>\r\n</td>\r\n<td>\r\n<p>802.11ac Wi-Fi wireless networking; IEEE 802.11a/b/g/n compatible. Bluetooth 4.2 wireless technology</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td class=\"a-text-bold\">\r\n<p>In the Box</p>\r\n</td>\r\n<td>\r\n<p>13-inch MacBook Air, 30W USB-C Power Adapter, USB-C Charge Cable (2 m)</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td class=\"a-text-bold\">\r\n<p>