(45, 6, 'orange13654', 'Wireless Solar Automobile Tire Temperature Monitoring Device Black', '26809', '<p>Feature:<br /><br />Auto-induction charging with solar power<br /><br />Triggering alarm against excessive pressure and temperature<br /><br />Sound and voice alarm<br /><br />Multiple pressure units(PSI and BAR optional)<br /><br />Multiple pressure units( and  optional)<br /><br />Users can set alarm vale for tire pressure and temperature<br /><br />Interchangeability of installation position on tire<br /><br />Display in capable of wake-up function with slight movement<br /><br />Display can automatically enable back light<br /><br />Display is equipped with re chargeable battery<br /><br />Monitoring up to seven tire(including spare tire)<br /><br />Display shoes the pressure or the temperature of four tires simultaneously<br /><br />Triggering alarm for emergency leakage<br /><br />Simple installation and stable performance<br /><br /><br /><br />Technical parameters of display<br /><br />Pressure set range:05-6.0 bar(7-87psi)<br /><br />Input voltage:DC 5V<br /><br />Temperature set range:50-99<br /><br />Frequency:433.92MHz<br /><br /><br /><br />Package include:<br /><br />1 set of tire temperature monitoring device</p>', NULL, '1.jpg', NULL, NULL, '26805', '2020-01-04 09:51:31', '1', 100, NULL, NULL, 5, NULL, 22, '0', 'yes', 'yes', NULL, 0, NULL, NULL, NULL, '', '', '', 'Red,sdf', NULL, NULL, NULL, NULL, 'solid', NULL, NULL, NULL, NULL, '1001,323', '<p>Feature:<br /><br />Auto-induction charging with solar power<br /><br />Triggering alarm against excessive pressure and temperature<br /><br />Sound and voice alarm<br /><br />Multiple pressure units(PSI and BAR optional)<br /><br />Multiple pressure units( and  optional)<br /><br />Users can set alarm vale for tire pressure and temperature<br /><br />Interchangeability of installation position on tire<br /><br />Display in capable of wake-up function with slight movement<br /><br />Display can automatically enable back light<br /><br />Display is equipped with re chargeable battery<br /><br />Monitoring up to seven tire(including spare tire)<br /><br />Display shoes the pressure or the temperature of four tires simultaneously<br /><br />Triggering alarm for emergency leakage<br /><br />Simple installation and stable performance<br /><br /></p>', '', '4', 'yes', '', '', '', 'Small,fdsfsd', 0, 'Orange State', '1 kg', 'asd,wdsfds', 'dasd,sdf'),
