(51, 21, 'SVBSD2', 'Prestige Stainless Steel Value Pack Pressure Cooker 5 Litre & 2 Litre', '365241', '<p>India\'s favourite pressure cooker now with stainless steel body and induction base the widely used and appreciated prestige popular ss pressure cooker comes with top of the line features. This cooker is made using best quality stainless steel which improves the durability of the cooker. The legacy carried by prestige pressure cookers is sure to make your cooking experience delightful.</p>', NULL, '51cjWBKmM1L._SX679_.jpg', NULL, NULL, '20152', '2020-01-21 08:42:13', '1', 201, NULL, NULL, 0, NULL, 0, '0', 'yes', 'yes', NULL, 0, NULL, NULL, NULL, '', '', '', 'gray', NULL, NULL, NULL, NULL, 'Stainless steel body, precision weight valve, metallic safety plug', NULL, NULL, NULL, NULL, '10,20', '<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">Stainless steel body, precision weight valve, metallic safety plug</span></li>\r\n<li><span class=\"a-list-item\">Gasket-release system, Gas and induction compatible base</span></li>\r\n<li><span class=\"a-list-item\">Aluminium Polished, Color: Silver, Material: Stainless Steel</span></li>\r\n<li><span class=\"a-list-item\">Package contents: combo of Pressure Cooker 5 Litre and 2 Litre</span></li>\r\n<li><span class=\"a-list-item\">5 year manufacturer warranty</span></li>\r\n</ul>', '', '4', 'yes', '', '', '', '5 Litre,2 Litre', 0, 'Prestige', '5 Litre ', 'Gas and induction', ''),
(52, 10, '1TJ09A', 'HP Smart Tank 515 Wireless All-in-One (1TJ09A)', '73000', '<p>Functions Print, scan, copy, wireless Multitasking supported No Print speed black: ISO: Up to 11 ppm Draft: Up to 22 ppm 5 Print speed color: ISO:Up to 5 ppm Draft:Up to 16 ppm 5 First page out (ready) Black: As fast as 14 sec Color: As fast as 21 sec 7 Duty cycle (monthly, A4) Up to 1000 pages Recommended monthly page volume 400 to 800 Print technology HP Thermal Inkjet Printer drivers included HP PCL 3 GUI Print quality (best) Color: Up to 4800 x 1200 optimized dpi color (when printing from a computer and 1200 input dpi) Black: Up to 1200 x 1200 rendered dpi Display 7 segment + 2-inch icon display Processor speed 1.2 GHz Number of print cartridges 4 (1 each black bottle, set of 3 color bottles) Print languages HP PCL 3 GUI Automatic paper sensor No Connectivity Wireless capability Yes, built-in dual band Wi-Fi 802.11b/g/n, Wireless direct, BLE Connectivity, standard Hi-Speed USB 2.0, Wi-Fi, Bluetooth LE Connectivity, optional None Minimum system requirements Windows 10, 8.1, 8, 7: 32-bit or 64-bit, 2 GB available hard disk space, Internet connection, USB port, Internet Explorer. OS X v10.11 El Capitan and above, Internet Access Compatible operating systems Windows 10, Windows 8.1, Windows 8, Windows 7 OS X v10.11 El Capitan, macOS Sierra v10.12 (previously OS X), macOS High Sierra v10.13, macOS Mojave v10.14 (Windows 10, Windows 8.1, Windows 8, Windows 7; OS X v10.11 El Capitan, macOS Sierra v10.12 (previously OS X), macOS High Sierra v10.13, macOS Mojave v10.14) Mobility Mobile printing capability HP Smart app Apple AirPrint&trade; Fire&trade; Google Cloud Print 2.0 HP ePrint Android printing Mopria&trade;-certified 3 Memory specifications Memory card compatibility No Memory, standard 256 MB Integrated memory Maximum Memory 256 MB Paper handling Paper handling input, standard 100-sheet input tray Paper handling output, standard 30-sheet output tray Duplex printing Manual (driver support provided) Media sizes supported A4 B5 A6 DL envelope, legal Media sizes custom 76.2 x 127 to 215.9 x 355.6 mm Media types Plain paper, Matte Brochure Papers, Glossy Brochure Papers, Photo papers, Envelopes, Other specialty inkjet papers Media weights, recommended 75 g/m&sup2; Media weights, supported Plain paper: 60 to 90 g/m&sup2; Envelopes: 75 to 90 g/m&sup2; Cards: up to 200 g/m&sup2; Photo paper: up to 300 g/m&sup2; Borderless printing Yes (up to 8.5 x 11 in, 210 x 297 mm) Scanner specifications Scanner type Flatbed only Scan file format JPEG, TIFF, PDF, BMP, PNG Scan resolution, optical Up to 1200 dpi Bit depth 24-bit Scan size, maximum 216 x 297 mm Digital sending standard features Everyday scan (scan to PDF) HP Smart Tasks File Format Supported BMP PDF JPG PNG TIF Scan input modes Front Panel Scan Copy HP Software EWS Copier specifications Copy resolution (black text) Up to 600 dpi Copy resolution (color text and graphics) Up to 600 dpi Copy reduce / enlarge settings 25 to 400% Copies, maximum Up to 99 copies Power and operating requirements Power Input voltage 100 to 240 VAC (+/- 10%), 50/60 Hz (+/- 3 Hz). High voltage: Input voltage 200 to 240 VAC (+/- 10%), 50/60 Hz (+/- 3Hz) Power consumption 0.12 watts (manual-Off), 3.12 watts (ready), 0.75 watt (sleep) 2 Operating temperature range 5 to 40&deg;C Recommended operating humidity range 20 to 80% RH Dimensions and weight Minimum dimensions (W x D x H) 447 x 373 x 158 mm 1 Maximum dimensions (W x D x H) 449 x 605.65 x 258.7 mm 1 Weight 5.14 kg Package weight 7.25 kg What\'s included What\'s in the box HP Smart Tank 515 HP GT53XL 135-ml Black Original Ink Bottle HP GT52 Cyan Original Ink Bottle HP GT52 Magenta Original Ink Bottle HP GT52 Yellow Original Ink Bottle Ink caution flyer Repacking flyer Setup guide Reference guide Regulatory flyer China warranty card China 3G card Indonesia warranty card QQ-Wechat flyer Power cord [For more information about fill and yield, see http://www.hp.com/go/learnaboutsu